import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import api, { setToken, setUser } from '../api';

export default function Login(){
  const nav = useNavigate();
  const [email,setEmail] = useState('');
  const [senha,setSenha] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  async function submit(e){
    e.preventDefault();
    setError('');
    setLoading(true);
    try{
      const { data } = await api.post('/auth/login', { email, password: senha });
      setToken(data.access_token);
      setUser(data.user);
      nav('/app', { replace: true });
    }catch(err){
      setError(err?.response?.data?.msg || 'Falha no login');
    }finally{
      setLoading(false);
    }
  }

  return (
    <div style={{minHeight:'100vh', display:'flex', alignItems:'center', justifyContent:'center', background:'#f5f7fb'}}>
      <div className="container">
        <div className="row justify-content-center align-items-center">
          {/* Logo à esquerda */}
          <div className="col-12 col-lg-5 mb-4 mb-lg-0 d-flex justify-content-center">
            <div className="card shadow-sm border-0" style={{maxWidth: 460, width:'100%', background:'white'}}>
              <div className="card-body d-flex flex-column align-items-center p-5">
                <img src="/logo.png" alt="AJ7" style={{maxWidth: 220, width:'100%', height:'auto'}} />
                <div className="mt-3 text-center">
                  <h5 className="mb-1" style={{color:'#0b2a4a'}}>AJ7 Seguros</h5>
                  <div className="text-muted">Controle de Vendas e Comissões</div>
                </div>
              </div>
            </div>
          </div>

          {/* Form à direita */}
          <div className="col-12 col-lg-5 d-flex justify-content-center">
            <div className="card shadow-sm border-0" style={{maxWidth: 420, width:'100%'}}>
              <div className="card-header" style={{background:'var(--brand-bg)', color:'#fff'}}>
                <strong>Entrar</strong>
              </div>
              <div className="card-body">
                <form onSubmit={submit}>
                  <label className="form-label">E-mail</label>
                  <input className="form-control mb-3" type="email" placeholder="seu@email.com"
                         value={email} onChange={e=>setEmail(e.target.value)} required />

                  <label className="form-label">Senha</label>
                  <input className="form-control mb-3" type="password" placeholder="••••••••"
                         value={senha} onChange={e=>setSenha(e.target.value)} required />

                  {error && <div className="alert alert-danger py-2">{error}</div>}

                  <button disabled={loading} className="btn btn-primary w-100">
                    {loading? 'Entrando...' : 'Entrar'}
                  </button>
                </form>
              </div>
              <div className="card-footer text-center text-muted" style={{fontSize:12}}>
                © {new Date().getFullYear()} <strong>Daniel Correa</strong>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
